            <h2 style="display:inline;">Verblijfplaats reigers<br></h2>

         Een bedrijventerrein in de Staatsliedenbuurt...waar er overigens meerdere van zijn, hoewel ze klein zijn. Toch de moeite waard om hier rond te kijken. Een gebied waar je niet snel komt, hoewel dergelijke terreinen dicht in de buurt kunnen zijn waar je woont. En als je daar rond scharrelt, is het ook weer zo afgelegen. Weinig voor de Amsterdammer om iets te beleven. Toch trekt het aan. De reigers overigens ook, die vinden daar een beschutte plek waar ze niet lastig worden gevallen.  
